	if (otpSeperator !== "" ) {
		password = params.password;
		var passwordFields = params.password.split(otpSeperator);
		if (password.length > 7 && passwordFields.length > 1) {
			var otpLength = passwordFields[passwordFields.length-1].length;
			passwordFields[0] = password.substring(0, password.length - (otpLength + 1));
			otp = passwordFields[passwordFields.length-1];
			password = passwordFields[0];
		}

	}
	else {
		 if(params.password.length > yubikeyOtpLength){
			 otp = handleOtp(params.password, yubikeyOtpLength);
			 password = handlePassword(params.password, yubikeyOtpLength);

		 }
		 else {
			 otp = handleOtp(params.password, nonYubiKeyotpLength);
			 password = handlePassword(params.password, nonYubiKeyotpLength);
		 }

	}

	function handleOtp(password, otpLength){

		return password.substring(password.length - otpLength, password.length);
	}

	function handlePassword(password, otpLength){

		return password.substring(0, password.length - otpLength);
	}


 return {'otp': otp , 'password': password}
}

